    const [password,setPassword]=useState("")
    const [tel,setTel]=useState("")
  return (
    <>
     <div className='main_div'>
        <div className='sub_of_main'>
        <h1>Register</h1>
        <form action="" className='input_form' method='post'>
            <input type="text" name="userName" id=""  required={true} placeholder='Username' onChange={handleuser}/>
            <input type="email" name="email" id="" required={true} placeholder='Email' onChange={handleemail}/>
             <input type="password" name="password" id="" required={true}  placeholder='Password' onChange={handlepassword}/>
             <input type="tel" name="phone_number" id="" required={true} placeholder='Phone' onChange={handlephone}/>
            <input type="submit" value="Signup" className='submit_btn'/>
        </form>
        <p><Link to="/">Already have an account</Link></p>
       
     </div> 
    </div>
    </>
  )
}

export default Register
